import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import Dashboard from './components/Dashboard';
// import EventManagement from './components/EventManagement'; // Example component
// import UserManagement from './components/UserManagement'; // Example component
// import ReportManagement from './components/ReportManagement'; // Example component
// import Settings from './components/Settings'; // Example component
import './AdminDashboard.css'; // Import the CSS file for AdminDashboard

const AdminDashboard = () => {
    return (
        <div className="admin-dashboard">
            <Sidebar />
            <div className="main-content">
                <Header />
                <Routes>
                    <Route path="/dashboard" element={<Dashboard />} />
                    {/* <Route path="/events" element={<EventManagement />} /> */}
                    {/* <Route path="/users" element={<UserManagement />} /> */}
                    {/* <Route path="/reports" element={<ReportManagement />} /> */}
                    {/* <Route path="/settings" element={<Settings />} /> */}
                    <Route path="/" element={<Dashboard />} />
                </Routes>
            </div>
        </div>
    );
};

export default AdminDashboard;
